  public async init(): Promise<void> {
    const {
      id = 'map',
      attributionControl = false,
      style = 'light',
      rotation = 0,
      mapInstance,
      ...rest
    } = this.config;

    this.viewport = new Viewport();

    if (mapInstance) {
      // @ts-ignore
      this.map = mapInstance;
      this.$mapContainer = this.map.getContainer();
    } else {
      this.$mapContainer = this.creatAmapContainer(id);
      // @ts-ignore
      this.map = new Map({
        container: this.$mapContainer,
        style: this.getMapStyle(style),
        bearing: rotation,
        ...rest,
      });
    }
    this.map.on('load', this.handleCameraChanged);
    this.map.on('move', this.handleCameraChanged);

    // TODO: 判断地图是否正在被拖拽
    this.map.on('dragstart', () => {
      this.dragging = true;
      return '';
    });
    this.map.on('dragend', () => {
      this.dragging = false;
      return '';
    });

    // 不同于高德地图，需要手动触发首次渲染
    this.handleCameraChanged();
  }

  // 初始化小程序地图
  public async initMiniMap(): Promise<void> {
    const {
      id = 'map',
      attributionControl = false,
      style = 'light',
      rotation = 0,
      mapInstance,
      canvas = null,
      hasBaseMap = false,
      ...rest
    } = this.config;

    this.viewport = new Viewport();

    this.$mapContainer = canvas;

    this.map = new Map({
      container: this.$mapContainer as HTMLElement,
      style: this.getMapStyle(style),
      bearing: rotation,
      // @ts-ignore
      canvas,
      ...rest,
    });

    if (!hasBaseMap) {
      // 没有地图底图的模式
      this.map.on('load', this.handleCameraChanged);
      this.map.on('move', this.handleCameraChanged);

      // 不同于高德地图，需要手动触发首次渲染
      this.handleCameraChanged();
    } else {
      // 存在地图底图的模式（ L7Mini ）
      const center = this.map.getCenter();
      // 不同于高德地图，需要手动触发首次渲染
      this.handleMiniCameraChanged(
        center.lng,
        center.lat,
        this.map.getZoom(),
        this.map.getBearing(),
        this.map.getPitch(),
      );
      $window.document.addEventListener('mapCameaParams', (event: any) => {
        const {
          e: { longitude, latitude, scale, bearing, pitch },
        } = event;
        this.handleMiniCameraChanged(
          longitude,
          latitude,
          scale - 1.25,
          bearing,
          pitch,
        );
      });
    }
  }

